import React from 'react';
import ReactDOM from 'react-dom';

const fname = 'Asad';
const lname = 'Khan';

ReactDOM.render(
  <React.Fragment>
    <h1> My name is {fname} {lname}</h1>
    <p>Your lucky number is { 3 * 110 }</p>
    <ol>
      <li>Dirilis Ertugral</li>
      <li>Mehmatik</li>
      <li>Namalum</li>
    </ol>
  </React.Fragment> ,
  document.getElementById('root')
)
